//src6, 1ms58ss
import React, { Component } from 'react';

class StudyForm extends Component {

  render() {
    return (
      <div className="row">

        <div class="panel panel-info">
          <div class="panel-heading">
            <h3 class="panel-title">Study Form</h3>
          </div>
          <div class="panel-body">
            Panel content
          </div>
        </div>

        
      </div>
    )
  }
};

export default StudyForm;
